import React, { useEffect } from "react";
import { useAppDispatch, useAppSelector } from "../../app/hooks";
import { getUser, user } from "../../features/Get/Get";
import "./Table.css";

function Table() {
  const user = useAppSelector((state) => state.getSlice);
  console.log(user);

  const dispatch = useAppDispatch();
  useEffect(() => {
    dispatch(getUser());
  }, []);

  return (
    <div>
      <table className="table table-striped">
        <thead className="thead-dark">
          <tr>
            <th>ID</th>
            <th scope="col">First Name</th>
            <th scope="col">Middle Name</th>
            <th scope="col">Last Name</th>
            <th scope="col">Email</th>
            <th scope="col">Phone</th>
            <th scope="col">Role</th>
            <th scope="col">Address</th>
            <th scope="col">Actions</th>
          </tr>
        </thead>
        
        <tbody>



<tr>
        {user.loading ? <div>Loading...</div> : null}
</tr>
<tr>
{!user.loading && user.error ? <div> {user.error} </div> : null} 
</tr>
          {user.users
            ? user.users.map((element: any) => {
                return (
                  <tr>
                    <th scope="row">{element.id}</th>
                    <td>{element.firstname}</td>
                      <td>{element.middlename}</td> 
                    <td>{element.lastname}</td>
                    <td>{element.email}</td>
                    <td>{element.phone}</td>
                    <td>{element.role}</td>
                    <td>{element.address}</td> 
                  </tr>
                );
              })
            : null}
        </tbody>
      </table>
    </div>
  );
}

export default Table;
